class CalculateMaxSubset {
    private arr: number[]
    private subsetSums: number[] = []
    private maxSum: number = 0

    constructor(input: string[]) {
        const arrLength = input[0]
        this.arr = [...input[1].split(' ')].map(num => parseInt(num))

        this.createSubsets()
        // Find maximum sum at any index
        console.log(this.maxSum)
    }

    private createSubsets() {
        // first 2 indexes are set
        // ! handle all negatives
        this.subsetSums[0] = this.arr[0] > 0 ? this.arr[0] : 0
        if (this.arr[0] > 0 || this.arr[1] > 0) {
            this.subsetSums[1] = this.arr[0] > this.arr[1] ? this.arr[0] : this.arr[1]
        } else {
            this.subsetSums[1] = 0
        }
        this.maxSum = this.subsetSums[1]
        // rest of indexes must have sum greater than maxSum
        for (let i = 2; i < this.arr.length; i++) {
            const numToAdd = this.arr[i]
            const maxFromPreviousSubset = this.subsetSums[i - 2]
            // const largerNum = numToAdd + maxFromPreviousSubset > numToAdd
            if (this.maxSum < numToAdd + maxFromPreviousSubset) {
                this.subsetSums[i] = numToAdd + maxFromPreviousSubset
                this.maxSum = this.subsetSums[i]
            } else if (this.maxSum < numToAdd) {
                this.subsetSums[i] = numToAdd
                this.maxSum = numToAdd
            } else {
                this.subsetSums[i] = this.maxSum
            }
        }
    }
}


